import React, { useEffect, useState } from "react";
import Asioss from "../config/Asiosss";
import Master from "../Layout/Master";

export default function Home() {
  const [isLoading, setLoading] = useState(true);
  useEffect(() => {
    Asioss.get("product").then((res) => {
      if (res.success === true) {
        setLoading(false);
      }
    });
  }, []);

  return (
    <Master>
      <div className="d-flex justify-content-center align-items-center p-5">
        <div className="spinner-border" role="status">
          <span class="sr-only">Loading...</span>
        </div>
      </div>
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <div className="card">
              <img
                src="https://store.storeimages.cdn-apple.com/8756/as-images.apple.com/is/ML2Q3_VW_34FR+watch-41-alum-blue-cell-7s_VW_34FR_WF_CO?wid=700&hei=700&trim=1%2C0&fmt=p-jpg&qlt=95&.v=1632171138000%2C1631661091000"
                className="card-image"
                alt=""
              />
              <div className="card-body">
                <h4 className="text-center">Product Title</h4>
                <div className="d-flex justify-content-between  mt-3">
                  <span className="btn btn-sm btn-outline-warning">10000</span>
                  <span className="btn btn-sm btn-danger">Add To Cart</span>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </Master>
  );
}
